import React from "react";
import "../Styles/Navbar.css";
import logo from "../img/-.png";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <nav class="navbar">
      <a href="">
        <img src={logo} alt="" />
      </a>
      <div className="menu-icon">
        <ul>
          <li>
            <a href="">Inicio</a>
          </li>
          <li>
            <a href="">Sobre m√≠</a>
          </li>
          <li>
            <a href="">Proyectos</a>
          </li>
          <li>
            <a href="">Habilidades</a>
          </li>
          <li>
            <a href="">Contacto</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
